INSERT INTO `policy_translations` (`id`, `policy_id`, `language`, `name`, `subname`, `description`, `created_at`, `updated_at`) VALUES
(3, 3, 'vi', 'Chính sách bảo mật thông tin', 'Chính sách bảo mật thông tin', '<p>Luci lu&ocirc;n hiểu rằng Qu&yacute; kh&aacute;ch h&agrave;ng rất quan t&acirc;m đến việc những th&ocirc;ng tin c&aacute; nh&acirc;n m&agrave; Qu&yacute; kh&aacute;ch đ&atilde; tin cậy cung cấp cho ch&uacute;ng t&ocirc;i được bảo mật v&agrave; sử dụng ra sao. Luci cam kết rằng những th&ocirc;ng tin n&agrave;y sẽ được ch&uacute;ng t&ocirc;i nỗ lực tối đa để bảo mật. Luci đảm bảo sẽ sử dụng th&ocirc;ng tin kh&aacute;ch h&agrave;ng một c&aacute;ch hợp l&yacute;, c&oacute; c&acirc;n nhắc để kh&ocirc;ng ngừng cải thiện chất lượng dịch vụ v&agrave; đem lại sự h&agrave;i l&ograve;ng cho Qu&yacute; kh&aacute;ch h&agrave;ng khi sử dụng sản phẩm/ dịch vụ của ch&uacute;ng t&ocirc;i.</p>\r\n\r\n<p><strong>1.Mục đ&iacute;ch v&agrave; phạm vi thu thập th&ocirc;ng tin</strong><br />\r\nĐể đăng k&yacute; sử dụng c&aacute;c dịch vụ phần mềm của Luci, Qu&yacute; kh&aacute;ch h&agrave;ng phải đăng k&yacute; t&agrave;i khoản v&agrave; cung cấp một số th&ocirc;ng tin như: T&ecirc;n doanh nghiệp, địa chỉ, m&atilde; số thuế, người li&ecirc;n hệ, số điện thoại, email v&agrave; một số th&ocirc;ng tin kh&aacute;c. Phần thủ tục đăng k&lrm;&yacute; n&agrave;y gi&uacute;p Luci x&aacute;c định th&ocirc;ng tin ch&iacute;nh x&aacute;c của Qu&yacute; kh&aacute;ch h&agrave;ng nhằm cung cấp quyền sử dụng c&aacute;c sản phẩm, dịch vụ phần mềm. Ngo&agrave;i ra, những th&ocirc;ng tin n&agrave;y sẽ gi&uacute;p Luci c&oacute; thể li&ecirc;n hệ để phục vụ Qu&yacute; kh&aacute;ch h&agrave;ng trong suốt qu&aacute; tr&igrave;nh sử dụng sản phẩm, dịch vụ của Luci.</p>\r\n\r\n<p><strong>2.Phạm vi sử dụng th&ocirc;ng tin</strong><br />\r\nLuci cam kết sẽ chỉ sử dụng th&ocirc;ng tin của Qu&yacute; kh&aacute;ch h&agrave;ng để:</p>\r\n\r\n<p>Quản l&yacute; v&agrave; cấp quyền sử dụng c&aacute;c sản phẩm, dịch vụ phần mềm m&agrave; Luci cung cấp cho kh&aacute;ch h&agrave;ng.<br />\r\nLi&ecirc;n lạc, gửi th&ocirc;ng b&aacute;o cho kh&aacute;ch h&agrave;ng khi sản phẩm, dịch vụ c&oacute; sự cập nhật, thay đổi.<br />\r\nGửi th&ocirc;ng b&aacute;o mời kh&aacute;ch h&agrave;ng đăng k&yacute; n&acirc;ng cấp sản phẩm hoặc gia hạn dịch vụ khi kh&aacute;ch h&agrave;ng sắp hết hạn sử dụng dịch vụ.<br />\r\nThực hiện c&aacute;c hoạt động chăm s&oacute;c, hỗ trợ sau b&aacute;n h&agrave;ng.<br />\r\nGiải quyết c&aacute;c khiếu nại, tranh chấp.<br />\r\nLuci cam kết kh&ocirc;ng chia sẻ th&ocirc;ng tin kh&aacute;ch h&agrave;ng cho bất kỳ b&ecirc;n thứ 3 n&agrave;o ngoại trừ khi c&oacute; y&ecirc;u cầu của cơ quan c&oacute; thẩm quyền của nh&agrave; nước.</p>\r\n\r\n<p><strong>3.Thời gian lưu trữ th&ocirc;ng tin</strong><br />\r\nTh&ocirc;ng tin của Qu&yacute; kh&aacute;ch h&agrave;ng l&agrave; dữ liệu đầu v&agrave;o quan trọng để Luci cung cấp v&agrave; quản l&yacute; quyền sử dụng c&aacute;c sản phẩm, dịch vụ phần mềm, v&igrave; thế th&ocirc;ng tin kh&aacute;ch h&agrave;ng sẽ được lưu trữ trong suốt qu&aacute; tr&igrave;nh hoạt động của Luci.</p>\r\n\r\n<p><strong>4.Cam kết bảo mật th&ocirc;ng tin c&aacute; nh&acirc;n kh&aacute;ch h&agrave;ng</strong><br />\r\nLuci cam kết lu&ocirc;n nỗ lực sử dụng những biện ph&aacute;p tốt nhất để bảo mật th&ocirc;ng tin của kh&aacute;ch h&agrave;ng nhằm đảm bảo những th&ocirc;ng tin n&agrave;y kh&ocirc;ng bị đ&aacute;nh cắp, tiết lộ ngo&agrave;i &yacute; muốn.<br />\r\nLuci cam kết kh&ocirc;ng chia sẻ, b&aacute;n hoặc cho thu&ecirc; th&ocirc;ng tin của kh&aacute;ch h&agrave;ng với bất kỳ b&ecirc;n thứ ba n&agrave;o.</p>', NULL, NULL),
(4, 4, 'vi', 'Hình thức thanh toán', 'Hình thức thanh toán', '<p>Khi đồng &yacute; sử dụng c&aacute;c sản phẩm, dịch vụ phần mềm của Luci, Qu&yacute; kh&aacute;ch h&agrave;ng sẽ phải thực hiện việc thanh to&aacute;n cho Luci trước khi nhận b&agrave;n giao sản phẩm. Ch&uacute;ng t&ocirc;i c&oacute; 2 h&igrave;nh thức thanh to&aacute;n như sau:</p>\r\n\r\n<p><strong>1.Thanh to&aacute;n trực tuyến</strong><br />\r\nKh&aacute;ch h&agrave;ng c&oacute; thể lựa chọn h&igrave;nh thức thanh to&aacute;n trực tuyến th&ocirc;ng qua c&aacute;c phương thức sau:</p>\r\n\r\n<p>Thanh to&aacute;n bằng thẻ nội địa: &aacute;p dụng trong trường hợp kh&aacute;ch h&agrave;ng muốn thanh to&aacute;n th&ocirc;ng qua Internet banking hoặc dịch vụ thanh trực tuyến tại c&aacute;c ng&acirc;n h&agrave;ng.<br />\r\nV&iacute; điện tử ng&acirc;n lượng: &aacute;p dụng trong trường hợp kh&aacute;ch h&agrave;ng muốn thanh to&aacute;n qua v&iacute; điện tử v&agrave; cổng thanh to&aacute;n trực tuyến tr&ecirc;n Internet.<br />\r\nThanh to&aacute;n bằng thẻ quốc tế: &aacute;p dụng trong trường hợp kh&aacute;ch h&agrave;ng lựa chọn thanh to&aacute;n th&ocirc;ng qua c&aacute;c thẻ quốc tế như: Visa, Master Card,&hellip;</p>\r\n\r\n<p><strong>2.Thanh to&aacute;n bằng tiền mặt</strong><br />\r\nTrường hợp tổng gi&aacute; trị thanh to&aacute;n dưới 20.000.000đ, kh&aacute;ch h&agrave;ng c&oacute; thể lựa chọn h&igrave;nh thức thanh to&aacute;n bằng tiền mặt trực tiếp cho nh&acirc;n vi&ecirc;n của Luci. Lưu &yacute;, kh&aacute;ch h&agrave;ng chỉ thanh to&aacute;n cho nh&acirc;n vi&ecirc;n của Luci khi c&oacute; đủ giấy tờ: Giấy giới thiệu của c&ocirc;ng ty về việc nhận tiền mặt hoặc Phiếu thu tiền (c&oacute; đ&oacute;ng dấu v&agrave; ghi r&otilde; số tiền), thẻ nh&acirc;n vi&ecirc;n, chứng minh nh&acirc;n d&acirc;n của người được ghi trong giấy giới thiệu.</p>\r\n\r\n<p>Ch&uacute; &yacute;: Sau khi thanh to&aacute;n bằng h&igrave;nh thức chuyển khoản hoặc thanh to&aacute;n trực tuyến, Qu&yacute; kh&aacute;ch h&agrave;ng n&ecirc;n li&ecirc;n lạc với bộ phận b&aacute;n h&agrave;ng của Luci để th&ocirc;ng b&aacute;o về việc Qu&yacute; kh&aacute;ch đ&atilde; thực hiện việc thanh to&aacute;n tiền. Luci sẽ kiểm tra tiền về t&agrave;i khoản v&agrave; thực hiện việc b&agrave;n giao sản phẩm cho Qu&yacute; kh&aacute;ch.</p>', NULL, NULL),
(5, 5, 'vi', 'Cynthia Parker', 'Forrest Terrell', '<p>jghjgjhj</p>', NULL, NULL);
