(2, 2, 'vi', 'Junior Tester', 'Fulltime - Ha Noi', '<p>Đọc v&agrave; ph&acirc;n t&iacute;ch t&agrave;i liệu đặc tả y&ecirc;u cầu nghiệp vụ phần mềm của dự &aacute;n.. Lập test plan, viết test case, chuẩn bị dữ liệu. Thiết lập m&ocirc;i trường kiểm thử, thực thi v&agrave; b&aacute;o c&aacute;o kết quả. Thực hiện kiểm thử, ph&aacute;t hiện lỗi v&agrave; phối hợp với c&aacute;c developer để sửa lỗi. eLog bugs, đ&aacute;nh gi&aacute; mức độ quan trọng v&agrave; mức độ khẩn cấp của bug. B&aacute;o c&aacute;o kết quả v&agrave; đ&aacute;nh gi&aacute; chất lượng sản phẩm.</p>', NULL, NULL);
