(3, 3, 'vi', 'Giải pháp  đèn đường thông minh', '{\"name\":\"gi\\u1ea3i ph\\u00e1p  \\u0111\\u00e8n \\u0111\\u01b0\\u1eddng th\\u00f4ng minh\",\"subname\":\"\\u0110\\u00e8n \\u0111\\u01b0\\u1eddng th\\u00f4ng minh Luci Lighting l\\u00e0 gi\\u1ea3i ph\\u00e1p chi\\u1ebfu s\\u00e1ng v\\u1edbi kh\\u1ea3 n\\u0103ng ti\\u1ebft ki\\u1ec7m l\\u00ean t\\u1edbi 70% n\\u0103ng l\\u01b0\\u1ee3ng. Luci Lighting khi\\u1ebfn cho qu\\u00e1 tr\\u00ecnh v\\u1eadn h\\u00e0nh tr\\u1edf n\\u00ean tr\\u01a1n tru v\\u1edbi c\\u00f4ng su\\u1ea5t ti\\u00eau th\\u1ee5 th\\u1ea5p \\u0111\\u1ebfn m\\u1ee9c t\\u1ed1i \\u0111a nh\\u1edd c\\u1ea3m bi\\u1ebfn b\\u1eadt \\u2013 t\\u1eaft t\\u1eeb xa. Luci t\\u1ef1 h\\u00e0o l\\u00e0 th\\u00e0nh vi\\u00ean Vi\\u1ec7t Nam \\u0111\\u1ea7u ti\\u00ean tham gia hi\\u1ec7p h\\u1ed9i chu\\u1ea9n c\\u00f4ng ngh\\u1ec7 k\\u1ebft n\\u1ed1i kh\\u00f4ng d\\u00e2y h\\u00e0ng \\u0111\\u1ea7u th\\u1ebf gi\\u1edbi WiSUN.\",\"button\":\"\\u0110\\u1ecdc th\\u00eam v\\u1ec1 ch\\u00fang t\\u00f4i\",\"thumbnail\":\"\\/upload\\/images\\/images\\/demo\\/Asset%203%201.png\"}', '{\"name\":\"\\u1ee8ng d\\u1ee5ng c\\u00f4ng ngh\\u1ec7 v\\u01b0\\u1ee3t tr\\u1ed9i\",\"subname\":\"Ng\\u00e0y nay, khi c\\u00f4ng ngh\\u1ec7 \\u0111ang c\\u00f3 nh\\u1eefng b\\u01b0\\u1edbc ph\\u00e1t tri\\u1ec3n v\\u01b0\\u1ee3t b\\u1eadc, vi\\u1ec7c \\u1ee9ng d\\u1ee5ng khoa h\\u1ecdc v\\u00e0o trong \\u0111\\u1eddi s\\u1ed1ng l\\u1ea1i c\\u00e0ng \\u0111\\u01b0\\u1ee3c ng\\u01b0\\u1eddi d\\u00f9ng quan t\\u00e2m. H\\u1ec7 th\\u1ed1ng chi\\u1ebfu s\\u00e1ng th\\u00f4ng minh Luci Lighting t\\u1ef1 tin \\u0111em \\u0111\\u1ebfn cho h\\u1ec7 th\\u1ed1ng qu\\u1ea3n l\\u00fd nh\\u1eefng \\u1ee9ng d\\u1ee5ng th\\u1ef1c ti\\u1ec5n thi\\u1ebft th\\u1ef1c nh\\u1ea5t.\",\"array\":{\"feature_item1\":{\"image\":\"\\/upload\\/images\\/images\\/demo\\/Group%2036.png\",\"name\":\"\\u0110i\\u1ec1u ch\\u1ec9nh \\u0111\\u1ed9 s\\u00e1ng theo nhu c\\u1ea7u\",\"list\":[\"V\\u1edbi gi\\u1ea3i ph\\u00e1p chi\\u1ebfu s\\u00e1ng th\\u00f4ng minh, ng\\u01b0\\u1eddi \\u0111i\\u1ec1u khi\\u1ec3n c\\u00f3 th\\u1ec3 d\\u1ec5 d\\u00e0ng ki\\u1ec3m tra v\\u00e0 \\u0111i\\u1ec1u ch\\u1ec9nh h\\u1ec7 th\\u1ed1ng chi\\u1ebfu s\\u00e1ng t\\u1ef1 \\u0111\\u1ed9ng ho\\u1eb7c h\\u1eb9n tr\\u01b0\\u1edbc. \\u0110\\u1eb7c bi\\u1ec7t, t\\u1ea1i c\\u00e1c khu \\u0111\\u00f4 th\\u1ecb l\\u1edbn, vi\\u1ec7c ki\\u1ec3m so\\u00e1t \\u0111\\u00e8n t\\u1eaft\\/m\\u1edf t\\u1eeb xa n\\u00e0o s\\u1ebd tr\\u1edf n\\u00ean d\\u1ec5 d\\u00e0ng h\\u01a1n.\"]},\"feature_item2\":{\"image\":\"\\/upload\\/images\\/images\\/demo\\/Group%2037.png\",\"name\":\"k\\u1ebft h\\u1ee3p c\\u00e1c c\\u1ea3m bi\\u1ec3n ai\",\"list\":[\"Trong khu \\u0111\\u00f4 th\\u1ecb \\u0111\\u00f2i h\\u1ecfi l\\u01b0\\u1ee3ng \\u0111\\u00e8n \\u0111\\u01b0\\u1eddng, \\u0111\\u00e8n c\\u1ea7u thang l\\u1edbn, vi\\u1ec7c \\u1ee9ng d\\u1ee5ng h\\u1ec7 th\\u1ed1ng chi\\u1ebfu s\\u00e1ng th\\u00f4ng minh gi\\u00fap ch\\u1ee7 \\u0111\\u1ed9ng trong qu\\u00e1 tr\\u00ecnh \\u0111i\\u1ec1u khi\\u1ec3n \\u00e1nh s\\u00e1ng, gi\\u00fap ti\\u1ebft ki\\u1ec7m \\u0111\\u01b0\\u1ee3c l\\u01b0\\u1ee3ng l\\u1edbn \\u0111i\\u1ec7n n\\u0103ng ti\\u00eau th\\u1ee5 l\\u00ean \\u0111\\u1ebfn 70%.\"]},\"feature_item3\":{\"image\":\"\\/upload\\/images\\/images\\/demo\\/Group%2038.png\",\"name\":\"\\u0111i\\u1ec1u khi\\u1ec3n ch\\u1ec9 v\\u1edbi m\\u1ed9t ch\\u1ea1m\",\"list\":[\"Trong khu \\u0111\\u00f4 th\\u1ecb \\u0111\\u00f2i h\\u1ecfi l\\u01b0\\u1ee3ng \\u0111\\u00e8n \\u0111\\u01b0\\u1eddng, \\u0111\\u00e8n c\\u1ea7u thang l\\u1edbn, vi\\u1ec7c \\u1ee9ng d\\u1ee5ng h\\u1ec7 th\\u1ed1ng chi\\u1ebfu s\\u00e1ng th\\u00f4ng minh gi\\u00fap ch\\u1ee7 \\u0111\\u1ed9ng trong qu\\u00e1 tr\\u00ecnh \\u0111i\\u1ec1u khi\\u1ec3n \\u00e1nh s\\u00e1ng, gi\\u00fap ti\\u1ebft ki\\u1ec7m \\u0111\\u01b0\\u1ee3c l\\u01b0\\u1ee3ng l\\u1edbn \\u0111i\\u1ec7n n\\u0103ng ti\\u00eau th\\u1ee5 l\\u00ean \\u0111\\u1ebfn 70%.\"]},\"feature_item4\":{\"image\":\"\\/upload\\/images\\/images\\/demo\\/Group%2036.png\",\"name\":\"\\u0111i\\u1ec1u khi\\u1ec3n ch\\u1ec9 v\\u1edbi m\\u1ed9t ch\\u1ea1m\",\"list\":[\"B\\u1eb1ng B\\u1ed9 \\u0111i\\u1ec1u khi\\u1ec3n trung t\\u00e2m k\\u1ebft n\\u1ed1i v\\u1edbi m\\u00e1y ch\\u1ee7 \\u0111\\u00e1m m\\u00e2y Cloud Server b\\u1eb1ng 4G LTE m\\u00e0 Luci Lighting c\\u00f3 th\\u1ec3 \\u0111\\u01b0\\u1ee3c \\u0111i\\u1ec1u khi\\u1ec3n t\\u1eeb xa m\\u1ed9t c\\u00e1ch d\\u1ec5 d\\u00e0ng, thu\\u1eadn ti\\u1ec7n th\\u00f4ng qua \\u1ee9ng d\\u1ee5ng di \\u0111\\u1ed9ng v\\u00e0 giao di\\u1ec7n tr\\u1ef1c tuy\\u1ebfn.\",null,null]}}}', '{\"name\":\"luci lighting bao g\\u1ed3m nh\\u1eefng g\\u00ec?\",\"array\":{\"optimal_item1\":{\"image\":\"\\/upload\\/images\\/images\\/demo\\/Rectangle%2076%20(1).png\",\"name\":\"B\\u1ed9 \\u0111i\\u1ec1u khi\\u1ec3n \\u0111\\u00e8n \\u0111\\u01b0\\u1eddng NEMA\",\"list\":[\"B\\u1ed9 \\u0111i\\u1ec1u khi\\u1ec3n trung t\\u00e2m k\\u1ebft n\\u1ed1i \\u0111\\u01b0\\u1ee3c thi\\u1ebft k\\u1ebf d\\u01b0\\u1edbi d\\u1ea1ng \\u1ed5 ph\\u00e1t quang d\\u1ef1a tr\\u00ean ti\\u00eau chu\\u1ea9n WiSUN th\\u00f4ng qua m\\u1ea1ng l\\u01b0\\u1edbi 4G LTE m\\u00e0 k\\u1ebft n\\u1ed1i v\\u1edbi m\\u00e1y ch\\u1ee7 \\u0111\\u00e1m m\\u00e2y Cloud Server. Nh\\u1edd v\\u1eady th\\u00f4ng qua \\u1ee9ng d\\u1ee5ng di \\u0111\\u1ed9ng v\\u00e0 giao di\\u1ec7n Website, \\u0111\\u01a1n v\\u1ecb qu\\u1ea3n l\\u00fd c\\u00f3 th\\u1ec3 d\\u1ec5 d\\u00e0ng \\u0111i\\u1ec1u khi\\u1ec3n, theo d\\u00f5i h\\u1ec7 th\\u1ed1ng \\u0111\\u00e8n l\\u00ean \\u0111\\u1ebfn h\\u00e0ng ngh\\u00ecn chi\\u1ebfc trong ph\\u1ea1m vi b\\u00e1n k\\u00ednh h\\u01a1n 10km.\"],\"button\":\"Th\\u00f4ng tin chi ti\\u1ebft\"},\"optimal_item2\":{\"image\":\"\\/upload\\/images\\/images\\/demo\\/Rectangle%2077%20(2).png\",\"name\":\"H\\u1ec7 th\\u1ed1ng t\\u1ee7 \\u0111i\\u1ec7n chi\\u1ebfu s\\u00e1ng trung t\\u00e2m\",\"list\":[\"H\\u1ec7 th\\u1ed1ng \\u0111i\\u1ec1u khi\\u1ec3n th\\u00f4ng minh c\\u1ee7a Luci Lighting c\\u00f3 th\\u1ec3 thay th\\u1ebf cho s\\u1ef1 can thi\\u1ec7p c\\u1ee7a con ng\\u01b0\\u1eddi \\u0111\\u1ec3 ho\\u1ea1t \\u0111\\u1ed9ng nh\\u01b0 m\\u1ed9t h\\u1ec7 th\\u1ed1ng t\\u1ef1 \\u0111\\u1ed9ng ho\\u00e1 \\u0111\\u1ec3 b\\u1eadt\\/t\\u1eaft \\u0111\\u00e8n. T\\u1eeb \\u0111\\u00f3, vi\\u1ec7c chi\\u1ebfu s\\u00e1ng \\u0111\\u01b0\\u1eddng ph\\u1ed1 tr\\u1edf n\\u00ean hi\\u1ec7u qu\\u1ea3 h\\u01a1n, \\u00edt ti\\u00eau t\\u1ed1n n\\u0103ng l\\u01b0\\u1ee3ng h\\u01a1n v\\u00e0 \\u00edt g\\u00e2y \\u00f4 nhi\\u1ec5m h\\u01a1n.\"],\"button\":\"Th\\u00f4ng tin chi ti\\u1ebft\"},\"optimal_item3\":{\"image\":\"\\/upload\\/images\\/images\\/demo\\/Rectangle%2083%20(2).png\",\"name\":\"WISUN Gateway\",\"list\":[\"Luci Lighting th\\u00f4ng qua WiSUN border router, m\\u00e0 c\\u00e1c d\\u1eef li\\u1ec7u t\\u1eeb h\\u1ec7 th\\u1ed1ng chi\\u1ebfu s\\u00e1ng \\u0111\\u01b0\\u1ee3c chuy\\u1ec3n v\\u00e0o h\\u1ec7 th\\u1ed1ng theo d\\u00f5i \\u1edf m\\u00e1y ch\\u1ee7. Nh\\u1edd \\u0111\\u00f3, nh\\u00e0 qu\\u1ea3n l\\u00fd c\\u00f3 th\\u1ec3 d\\u1ec5 d\\u00e0ng theo d\\u00f5i v\\u00e0 \\u0111i\\u1ec1u khi\\u1ec3n qu\\u00e1 tr\\u00ecnh chi\\u1ebfu s\\u00e1ng th\\u00f4ng qua website ho\\u1eb7c \\u1ee9ng d\\u1ee5ng di \\u0111\\u1ed9ng.\"],\"button\":\"Th\\u00f4ng tin chi ti\\u1ebft\"}}}', '{\"name\":\"gi\\u1ea3i ph\\u00e1p chi\\u1ebfu s\\u00e1ng \\u0111\\u01b0\\u1eddng ph\\u1ed1 ti\\u00ean phong t\\u1ea1i vi\\u1ec7t nam\",\"subname\":\"Kh\\u00f4ng ch\\u1ec9 d\\u1eebng l\\u1ea1i \\u1edf \\u1ee9ng d\\u1ee5ng th\\u1ef1c ti\\u1ec5n, h\\u1ec7 th\\u1ed1ng chi\\u1ebfu s\\u00e1ng Luci Lighting c\\u00f2n mang l\\u1ea1i nhi\\u1ec1u h\\u01a1n th\\u1ebf. V\\u1edbi c\\u00f4ng ngh\\u1ec7 th\\u00f4ng minh gi\\u00fap nh\\u00e0 qu\\u1ea3n l\\u00fd ti\\u1ebft ki\\u1ec7m h\\u00e0ng lo\\u1ea1t chi ph\\u00ed, ki\\u1ec3m so\\u00e1t t\\u00e0i s\\u1ea3n d\\u1ec5 d\\u00e0ng tr\\u00e1nh th\\u1ea5t tho\\u00e1t kh\\u00f4ng \\u0111\\u00e1ng x\\u1ea3y ra.\",\"array\":{\"include_item1\":{\"image\":\"\\/upload\\/images\\/images\\/icon\\/Frame%2015541%20(2).png\",\"name\":\"Ti\\u1ebft ki\\u1ec7m chi ph\\u00ed v\\u1eadn h\\u00e0nh\",\"subname\":\"Ch\\u1ec9 c\\u1ea7n 1 ch\\u1ea1m v\\u1edbi 1 nh\\u00e2n c\\u00f4ng \\u0111\\u00e3 c\\u00f3 th\\u1ec3 \\u0111i\\u1ec1u khi\\u1ec3n c\\u1ea3 m\\u1ed9t h\\u1ec7 th\\u1ed1ng \\u0111\\u00e8n \\u0111\\u01b0\\u1eddng h\\u00e0ng ngh\\u00ecn chi\\u1ebfc.\"},\"include_item2\":{\"image\":\"\\/upload\\/images\\/images\\/icon\\/Frame%2015541%20(4).png\",\"name\":\"N\\u00e2ng cao tu\\u1ed5i th\\u1ecd c\\u1ee7a \\u0111\\u00e8n\",\"subname\":null},\"include_item3\":{\"image\":\"\\/upload\\/images\\/images\\/icon\\/Frame%2015541%20(2).png\",\"name\":\"Ki\\u1ec3m so\\u00e1t t\\u00e0i s\\u1ea3n d\\u1ec5 d\\u00e0ng\",\"subname\":\"Nh\\u1edd h\\u1ec7 th\\u1ed1ng ki\\u1ec3m so\\u00e1t t\\u1eeb xa, nh\\u00e0 qu\\u1ea3n l\\u00fd d\\u1ec5 d\\u00e0ng ph\\u00e1t hi\\u1ec7n \\u0111\\u00e8n t\\u1ea1i khu v\\u1ef1c n\\u00e0o b\\u1ecb h\\u1ecfng, kh\\u00f4ng ho\\u1ea1t \\u0111\\u1ed9ng \\u0111\\u1ec3 nhanh ch\\u00f3ng ph\\u00e1t hi\\u1ec7n v\\u00e0 x\\u1eed l\\u00fd.\"},\"include_item4\":{\"image\":\"\\/upload\\/images\\/images\\/icon\\/Frame%2015541%20(3).png\",\"name\":\"Ti\\u1ebft ki\\u1ec7m chi ph\\u00ed s\\u1eed d\\u1ee5ng \\u0111i\\u1ec7n l\\u00ean \\u0111\\u1ebfn 70%\",\"subname\":\"Nh\\u1edd h\\u1ec7 th\\u1ed1ng c\\u1ea3m bi\\u1ebfn b\\u1eadt\\/t\\u1eaft t\\u1ef1 \\u0111\\u1ed9ng khi c\\u00f3 chuy\\u1ec3n \\u0111\\u1ed9ng m\\u00e0 Luci Lighting gi\\u00fap ti\\u1ebft ki\\u1ec7m chi ph\\u00ed s\\u1eed d\\u1ee5ng \\u0111i\\u1ec7n l\\u00ean \\u0111\\u1ebfn 70%.\"}}}'),
